function formatInterface(fields) {
	const { properties } = fields;
	const spec = [];

	const removeWord = (text, word, returnArray = false) => returnArray ? text.split(word) : text.split(word).join("");
	const capitalizeFirstLetter = (string) => string.charAt(0).toUpperCase() + string.slice(1);
	const formatLabel = (label) => removeWord(label, "_", true).map(item => capitalizeFirstLetter(item)).join(" ");
	const formatName = (name, metaName) => [name, metaName].join("_");
	const template = (label, name, type) => ({label, name, type});
	const formatObject = (obj, name, toEscape) => {
		const { properties } = obj;
		return Object.keys(properties).map(prop => {
			let innerName = formatName(name, prop);
			if (toEscape) toEscape.map(item => innerName = removeWord(innerName, item));
			let label = formatLabel(name) + " " + formatLabel(prop);
			return template(label, innerName, "text");
		});
	}
	const getField = (field) => {
		const result = properties[field];
		const output = [];
		let name = "";
		let type = "";
		name = field.split("_text").join("");
		switch(result["type"]) {
			case("string"): type = "text"; break;
			case("object"): type = "collection"; break;
			default: type = result["type"];
							 }

		if (type === "collection") {
			output.push(...formatObject(result, name));
		} else if (type === "array") {
			const arrayType = result["items"]["type"];
			if (arrayType === "object") {
				output.push(...formatObject(result["items"], name, ["_key"]));
			}
		} else {
			output.push(template(formatLabel(name), name, type));
		}
		return output;
	}

	(Object.keys(properties) || []).map(field => {
		if (field !== 'message_id_text'){
			const ready = getField(field);
			if (ready.constructor.name === "Array") spec.push(...ready);
			else spec.push(ready);
		}
	});

	return spec;
}
